import React from 'react';
import './App.css';
import {Navbar, Button, Row, Col, Container} from 'react-bootstrap';
import {UserEntry} from './model/ToDoEntry';
import List from './components/List';
import Add from './components/Add';

class App extends React.Component<{}, { title: string, todos: UserEntry[] }> {
  constructor(props: {}) {
    super(props);
    this.state = {
      title: 'UserManager', todos: [
        new UserEntry('kevin','Piam','student'),
        new UserEntry('Winnie','Tongle','student'),
        new UserEntry('Maxwell','Tchiabe','hhh')
      ]
    }
  }


  render() {
    return <div>
      <Navbar bg="light">
        <Navbar.Brand>{this.state.title}</Navbar.Brand>
      </Navbar>
      <Container>
        <Row>
          <Col md={9}>
            <h3>User List</h3>
            <List items={this.state.todos}/>
          </Col>
        </Row>
      </Container>

    </div>;
  }
}

export default App;
